solution:
To perform division in complex numbers, we multiply both the numerator and the denominator by the conjugate of the denominator. In this case, the conjugate of $1+2i$ is $1-2i$. Multiplying: \begin{align*}
\frac{-3+4i}{1+2i}&=\frac{(-3+4i)(1-2i)}{(1+2i)(1-2i)}\\
&=\frac{-3+4i+6i-8i^2}{1+2i-2i-4i^2}\\
&=\frac{5+10i}{5}\\
&=\boxed{1+2i}
\end{align*}

If a triangle with sides of length 1, $x$, and $y$ exists, the triangle inequality must be satisfied, which states that $x+y>1$, $1+x>y$, and $1+y>x$.  We can draw a plane with $x$ and $y$ axes and shade in the area where all of these inequalities are satisfied.

[asy]
draw((0,0)--(3,0)--(3,3)--(0,3));
